import "./App.css";
import {Routes,Route,BrowserRouter} from "react-router-dom";
import Navbar from "./components/Navbar";
import Signup from "./components/Signup";
import Login from "./components/Login";

const App = () => {
  
  return (
    <>
     <BrowserRouter>
     <Navbar/>
      <Routes>
        <Route path="/" element={<h1>Home Component</h1>}/>
        <Route path="/blog" element={<h1>Blog Component</h1>}/>
        <Route path="/add" element={<h1>Add post Component</h1>}/>
        <Route path="/contact" element={<h1>Contact Component</h1>}/>
        <Route path="/login" element={<h1>Login component</h1>}/>
        <Route path="/signup" element={<Signup/>}/>
        <Route path="/logout" element={<h1>Logout Component</h1>}/>
      </Routes>
     </BrowserRouter>
    </>
  );
};

export default App;
